import React from "react";
import {BrowserRouter} from "react-router-dom";
import AppRouter from "./components/AppRouter";
import Navbar from "react-bootstrap/Navbar";

function App() {
    return (
        <BrowserRouter>
            <Navbar/>
            <AppRouter />
            <h1 className="text-primary">Добро пожаловать в React</h1>
            <p>Это пустое стартовое приложение.</p>
        </BrowserRouter>
    );
}

export default App;
